import React from 'react';

function Sell() {
    return (
        <div classname='marketSection'>
            <center>
                <h1>We buy used books!</h1>
                <p>Whether it's old or new, a classic or a recent hit, we'll gladly give your beloved books a new home!</p>
            </center>
        </div>
    )
}

export default Sell;
